import React from "react";
import { VideoButton } from "arclight-react";

export default function VButton(props) {
  return (
    <a href="new-member.html">
      <VideoButton
        style={"a"}
        data={{
          src: props.src,
          type: "video/mp4",
          cnt: (
            <div
              data-aos="fade-right"
              style="background-position: center; background-size: cover; height: 300px; padding-top: 220px;"
            >
              <div className="GoldBkg" style="height: 80px;">
                <div className="BlockTitle">
                  <i
                    className="fas fa-user-plus"
                    style="padding-right: 5px;"
                  ></i>
                  New Members
                </div>
                <div className="BlockText">
                  New to TES? Click here to get a valet tour of what we offer.
                </div>
              </div>
            </div>
          )
        }}
      />
    </a>
  );
}
